import moment from "moment";
import React, { useState } from "react";
import { useSelector } from "react-redux";
import { Link } from "react-router-dom";
import Message from "../LoadingError/Error";
import Loading from "../LoadingError/Loading";
const Orders = (props) => {
  const { loading, error, orders } = props;
  const orderDetails = useSelector((state) => state.orderDetails);
  const { orderDetail } = orderDetails;

  const [show, setShow] = useState(false);
  const [orderId, setOrderId] = useState("");

  const handleShow = (orderId) => {
    setShow(true);
    setOrderId(orderId);
  };

  const handleClose = () => setShow(false);
  return (
    <>
      <div
        className="modal fade"
        id="exampleModal"
        tabIndex="-1"
        aria-labelledby="exampleModalLabel"
        aria-hidden="true"
      >
        <div className="modal-dialog modal-dialog-centered">
          <div className="modal-content">
            <div className="modal-header">
              <h5 className="modal-title" id="exampleModalLabel">
                Choose your shipping address
              </h5>
              <button
                type="button"
                className="btn-close"
                data-bs-dismiss="modal"
                aria-label="Close"
              ></button>
            </div>
            <div className="modal-body">
              {/* {shippingAddress.length === 0 ? ( */}
              {/* <p>You have not added any shipping address yet.</p>) : ( */}
              <ul className="list-group">
                {/* {shippingAddress.map((address) => ( */}
                <li
                  // key={address.id}
                  className="list-group-item d-flex justify-content-between align-items-center"
                >
                  <div
                    // onClick={() => removeAddressHandle(address.id)}
                    className="remove-button d-flex justify-content-center align-items-center"
                  >
                    <i className="fas fa-times"></i>
                  </div>
                  <div></div>
                </li>
                {/* ))} */}
              </ul>
              {/* )} */}
            </div>
          </div>
        </div>
      </div>
      <div className=" d-flex justify-content-center align-items-center flex-column">
        {loading ? (
          <Loading />
        ) : error ? (
          <Message variant="alert-danger">{error}</Message>
        ) : (
          <>
            {orders.length === 0 ? (
              <div className="col-12 alert alert-info text-center mt-3">
                No Orders
                <Link
                  className="btn btn-success mx-2 px-3 py-2"
                  to="/"
                  style={{
                    fontSize: "12px",
                  }}
                >
                  START SHOPPING
                </Link>
              </div>
            ) : (
              <div className="table-responsive">
                <table className="table">
                  <thead>
                    <tr>
                      <th>ID</th>
                      <th>STATUS</th>
                      <th>DATE</th>
                      <th>TOTAL</th>
                      <th>Review</th>
                    </tr>
                  </thead>
                  <tbody>
                    {orders.map((order) => (
                      <tr
                        className={`${
                          order.isPaid ? "alert-success" : "alert-danger"
                        }`}
                        key={order.id}
                      >
                        <td>
                          <a href={`/order/${order.id}`} className="link">
                            {order.id}
                          </a>
                        </td>
                        <td>
                          {order.paidAt === null ? <>Not Paid</> : <> Paid</>}
                        </td>
                        <td>
                          {order.paidAt === null
                            ? moment(order.date).calendar()
                            : moment(order.paidAt).calendar()}
                        </td>
                        <td>${order.total}</td>
                        <td>
                          {order.paitAt !== null ? (
                            <button
                              type="button"
                              className="btn btn-primary mb-3"
                              data-bs-toggle="modal"
                              data-bs-target="#exampleModal"
                              // onClick={getAddressList}
                            >
                              Review
                            </button>
                          ) : (
                            "-"
                          )}
                        </td>
                      </tr>
                    ))}
                  </tbody>
                </table>
              </div>
            )}
          </>
        )}
      </div>
    </>
  );
};

export default Orders;
